							"name": "Selgitab iga põhiülesande protsessi vastutaja ",
							"description": "<p style=\"text-align:justify;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:12pt;font-weight:normal;font-style:normal;\">P&otilde;hi&uuml;lesande/&uuml;lesannete protsessi vastutaja m&auml;&auml;rab &uuml;ldvastutaja koost&ouml;&ouml;s keskastmejuhtidega, mille p&otilde;hjalt tehakse ettepanek juhtkonnale ja juhtkonna toetuse saamisel j&auml;tkatakse protsesside kirjeldamisega. Kui p&otilde;hi&uuml;lesande t&auml;itmine on antud &uuml;hele konkreetsele osakonnale, siis on v&otilde;ib lugeda vastutaja m&auml;&auml;ratuks (osakonnajuhtaja) ning v&otilde;ib j&auml;tta selle sammu vahele. &nbsp;</span></p><p style=\"text-align:justify;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:12pt;font-weight:normal;font-style:normal;\">&nbsp;</span><span style=\"color:#000000;background-color:transparent;font-family:Segoe UI;font-size:8pt;font-weight:normal;font-style:normal;\">&nbsp;</span></p><p style=\"text-align:justify;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:12pt;font-weight:normal;font-style:normal;\">Vastutus peab olema isikuline. Loetletud on rollid. Olenevalt asutusest v&otilde;ib &uuml;ks isik t&auml;ita mitut rolli, eriti v&auml;iksemates asutustes. N&auml;iteks v&otilde;ib sama isik vastutada protsesside ja teabehalduse eest.</span></p><p style=\"text-align:left;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:12pt;font-weight:normal;font-style:normal;\">Valdkonna eest vastutajal peavad olema p&auml;devus, volitused ja ressursid valdkonda juhtida.</span></p>",
