							"description": "<p style=\"text-align:left;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:12pt;font-weight:normal;font-style:normal;\">Asutus m&auml;&auml;rab igale otsesele avalikule teenusele ja tugiteenusele &quot;omaniku&quot; ehk vastutaja. Omaniku v&auml;ljaselgitamine peaks toimuma koost&ouml;&ouml;s asutuse &uuml;ldvastutajaga.</span></p><p style=\"text-align:left;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:8pt;font-weight:normal;font-style:normal;\">&nbsp;</span></p><p style=\"text-align:left;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:12pt;font-weight:bold;font-style:normal;\">Omanik vastutab teenus(t)e arendamise, haldamise ja kvaliteedi eest. </span></p><p style=\"text-align:left;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:12pt;font-weight:normal;font-style:normal;\">Teenuse omaniku &uuml;lesandeks on pakutavate teenuste protsesside optimeerimine, teenuste mugavamaks ja finantsiliselt ratsionaalsemaks muutmiseks v&otilde;imaluste otsimine ja nende realiseerimine, l&auml;htudes teenuse osutamisel tekkivast v&auml;&auml;rtusest.</span></p><p style=\"text-align:left;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Segoe UI;font-size:8pt;font-weight:normal;font-style:normal;\">&nbsp;</span></p><p style=\"text-align:left;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:12pt;font-weight:normal;font-style:normal;\">&nbsp;</span></p><p style=\"text-align:left;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:10pt;font-weight:normal;font-style:normal;\">N&auml;iteks. </span><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:10pt;font-weight:normal;font-style:normal;text-decoration: underline;\">Majandus- ja Kommunikatsiooniministeeriumis</span><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:10pt;font-weight:normal;font-style:normal;\"> on m&auml;&auml;ratud info&uuml;hiskonna teenuste arendamise osakonna juhataja vastutajaks info&uuml;hiskonna teenuste arendamise valdkonna poolt pakutavate tugiteenuste eest. </span></p><p style=\"text-align:left;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Calibri;font-size:10pt;font-weight:normal;font-style:normal;\">&nbsp;</span></p><p style=\"text-align:left;text-indent:0pt;margin:0pt 0pt 0pt 0pt;\"><span style=\"color:#000000;background-color:transparent;font-family:Segoe UI;font-size:8pt;font-weight:normal;font-style:normal;\">&nbsp;</span></p>",
